style.css:
@-moz-document domain("pipelines.amazon.com") {
div#action_bar, div#main, #content, .stages, h1, h2, h3 {
    background: #222 !important;
    color: #777 !important;
  }
  
  .business_card, .business_card h3 {
    background: #222 !important;
    color: #fff !important;
  }
  
  .search_result_row, .search_result_row td, .ui-tabs-panel {
    background: #222 !important;
  }
  
  .alt, .alt td, .stripe, #header, #header h1, table.pipelines tr:nth-child(2n+1), body {
    background: #333 !important;
  }
  
  .popover, #header .menu-content {
    background: #333 !important;
    color: #fff !important;
    border: 1px #000 solid !important;
  }
  
  .popover-title {
    background: #222 !important;
    color: #fff !important;
    border: 1px #000 solid !important;
  }
  
  .popover .adjacency, .popover .adjacency-options-row, .data-table tr:nth-child(2n) {
    background: #333 !important;
    color: #fff !important;
  }
  
  .popover tr.even, tr.even, .popover .adjacency-options-row tr:nth-child(2n) {
    background: #444 !important;
    color: #fff !important;
  }
  
  .adjacency {
    background: #222 !important;
    color: #fff !important;
  }
  
  .adjacency-bar {
    background: url("https://drive.corp.amazon.com/view/parthivv@/public/StylishImg/automation-arrow.png") no-repeat scroll right top;
  }
  
  .adjacency-bar.on {
    background-color: #050;
  }
 
  .adjacency-bar.disabled {
    background-color: #500;
  }
 
  .adjacency-bar.off {
    background-color: #444;
  }
  
  .pipeline .workflow .relative-time {
    color: #777;
  }
  
  #header .search-form, #header .search-text, #header input, .audit-log .timestamp {
    background: #222 !important;
    color: #ccc
  }
  
  #header .search-form .click-to-search {
    background: #000 url(https://internal-cdn.amazon.com/dtux.amazon.com/images/search_sprite.png) 0 0 no-repeat !important;
  }
  
  #footer, #footer h6, #footer .column h3, #header .menu-content h2, div.stage_info, div.stage_info h3, div.workflow, div.workflow h3 {
    background: #333 !important;
    color: #fff !important;
  }
  
  h1, input[readonly] {
    color: #fff !important;
  }
  
  #left_nav {
    background: #333 !important;
  }
  
  a, a:link, #footer a, .remove_link_style, .favorite {
    color: #0af !important;
  }
  
  .arrow, .arrow > * {
    filter: invert(100%) !important;
  }
  
  .status a, .hint, .explanation, .graph .legendLabel, .graph .tickLabel {
    color: #fff !important;
  }
  
  .badges a, a.button, a.fitness-badge, .merge-from, .alert, .heat_map div.name, .heat_map .revision-legend li {
    color: #000 !important;
  }
  
  button:not(.destructive-link), a.button, input[type="submit"] {
    filter: hue-rotate(150deg) saturate(2.5);
  }
  
  button.destructive, a.button.destructive, input.destructive[type="submit"], input.destructive[type="reset"] {
    color: #00f !important;
  }
  
  .tab a {
    background: linear-gradient(#000, #888 100%);
  }
 
  .tab a.active {
    background: linear-gradient(#333, #999 100%);
  }
  
  [class*="-button"]:not(.button) {
    background-color: rgba(0,0,0,0) !important;
  }
}
